description:
Excel 2010- All In One For Dummies.

A comprehensive, up-to-date, user-friendly guide to Excel 2010 Excel is the standard for spreadsheet applications and is used worldwide, but it's not always user-friendly. That makes it a perfect For Dummies topic, and this handy all-in-one guide covers all the essentials, the new features, how to analyze data with Excel, and much more. Eight minibooks address Excel basics, worksheet design, formulas and functions, worksheet collaboration and review, charts and graphics, data management, data analysis, and Excel and VBA. 

